function GetLatLng(){navigator.geolocation?navigator.geolocation.getCurrentPosition((o=>{const e=o.coords.latitude,t=o.coords.longitude;$(".getlatlng").data("longitude",t),$(".getlatlng").data("latitude",e),DirectoryReload(),console.log(`Latitude: ${e}, Longitude: ${t}`)}),(o=>{switch(o.code){case o.PERMISSION_DENIED:console.log("GetLatLngError: User denied the request for Geolocation");break;case o.POSITION_UNAVAILABLE:console.log("GetLatLngError: Location information is unavailable");break;case o.TIMEOUT:console.log("GetLatLngError: The request to get user location timed out");break;case o.UNKNOWN_ERROR:console.log("GetLatLngError: An unknown error occurred")}})):console.log("GetLatLngError: Geolocation is not supported by this browser")}